import React from 'react';

import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
    app: {
      textAlign: 'center',
      backgroundColor: '#002333',
      minHeight: '100vh',
      display: 'flex',
      flexDirection: 'column',
      margin: 0,
      padding: 0,
    },
    header: {
      backgroundColor: '#333',
      color: 'white',
    },
    nav: {
      backgroundColor: '#053047',
      color: 'white',
      padding: '20px',
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      height: '40px',
      margin: 0,
    },
    logo: {
      marginLeft: '20px',
      fontSize: '1.5rem',
      fontWeight: 'bold',
    },
    navUl: {
      listStyleType: 'none',
      padding: 0,
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      margin: 0,
    },
    navLi: {
      margin: '0 15px',
      cursor: 'pointer',
    },
    loginButton: {
      backgroundColor: '#002333',
      color: '#00ff84',
      padding: '10px 15px',
      borderRadius: '0px',
      cursor: 'pointer',
      marginRight: '20px',
    },
    contactSection: {
        backgroundColor: '#053047',
        padding: '20px 0',
      },
      contactHeading: {
        color: 'white',
      },
  footer: {
    backgroundColor: '#053047',
    color: 'white',
    padding: '30px',
    bottom: 0,
    width: 'auto',
  },
};

  const NavBar = () => (
    <nav style={{ ...styles.nav, marginTop: '0' }}> {/* Added marginTop: '0' */}
      <div style={styles.logo}>Logo</div>
      <ul style={styles.navUl}>
        <li style={styles.navLi}>Home</li>
        <li style={styles.navLi}>Our Missions</li>
        <li style={styles.navLi}>About Us</li>
        <li style={styles.navLi}>Clubs</li>
        <li style={styles.navLi}>Contact Us</li>
      </ul>
      <div style={styles.loginButton}>Login</div>
    </nav>
  );
  const Contact = () => (
    <div style={styles.app}>
    <div style={{ textAlign: 'center', color: 'white', paddingTop: '20px' }}>
      <h1>Contact Us</h1>
      {/* Add any additional content for the Contact Us section here */}
    </div>
  </div>
);
const Details = () => (
    <div style={styles.detailsSection}>
      <div style={styles.detailsField}>Name:</div><br></br>
      <div style={styles.detailsField}>Email ID:</div><br></br>
      <div style={styles.detailsField}>Institution:</div><br></br>
      <div style={styles.detailsField}>Phone Number:</div><br></br>
      <div style={styles.detailsField}>Country:</div><br></br>
    </div>
  );
  const Footer = () => (

    <footer style={{ ...styles.footer, display: 'flex', alignItems: 'center', justifyContent: 'space-between', padding: '30px' }}>

      <div style={{ marginRight: 'auto', textAlign: 'left' }}>
        <h2 style={{ marginBottom: '5px' }}>Contact Us</h2>
        <ul style={{ listStyle: 'none', padding: 0 }}>
          <li>• Company Name: ABC Corporation</li>
          <li>• Email: info@abccorp.com</li>
          <li>• Phone: (555) 123-4567</li>
          <li>• Address: 123 Main Street, Cityville, State, 12345</li>
        </ul>
      </div>
      <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', marginRight: 'auto', textAlign: 'left'}}>

        <h2 style={{ marginBottom: '10px' }}>Menu</h2>
        <ul style={{ listStyle: 'none', padding: 0 }}>
          <li>• Home</li>
          <li>• About Us</li>
          <li>• Partners</li>
          <li>• Clubs</li>
          <li>• Contact Us</li>
        </ul>
      </div>
      <div style={{ textAlign: 'center' ,display: 'flex', flexDirection: 'column', alignItems: 'left' }}>
        <div style={{ width: '50px', height: '50px', borderRadius: '50%', backgroundColor: '#ccc', marginBottom: '10px' }}></div>
        <p>Follow us on</p>
        <div style={{ display: 'flex' }}>
          <div style={{ width: '20px', height: '20px', borderRadius: '50%', backgroundColor: '#ccc', marginRight: '5px' }}></div>
          <div style={{ width: '20px', height: '20px', borderRadius: '50%', backgroundColor: '#ccc', marginRight: '5px' }}></div>
          <div style={{ width: '20px', height: '20px', borderRadius: '50%', backgroundColor: '#ccc', marginRight: '5px' }}></div>
        </div>
      </div>
    </footer>
  );
  const ContactUs = () => (
    <div style={styles.App}>

      <NavBar />
      <Contact />

      <Footer />
    </div>
  );


  export default ContactUs;
